import React from 'react';
import { motion } from 'framer-motion';
import { useQuery } from 'react-query';
import { ChevronRight, Shield, Zap, Globe, Factory, Users, Award } from 'lucide-react';
import { Link } from 'react-router-dom';
import HeroSection from '../components/home/HeroSection';
import FeaturedProducts from '../components/home/FeaturedProducts';
import CompanyStats from '../components/home/CompanyStats';
import ServiceHighlights from '../components/home/ServiceHighlights';
import Testimonials from '../components/home/Testimonials';
import CallToAction from '../components/home/CallToAction';
import { getFeaturedProducts } from '../services/api';

const Home = () => {
  const { data: featuredProducts, isLoading } = useQuery('featuredProducts', getFeaturedProducts);

  const features = [
    {
      icon: Shield,
      title: 'Quality Guarantee',
      description: 'All our machinery meets international quality standards with comprehensive warranties.'
    },
    {
      icon: Zap,
      title: 'AI-Powered Machinery',
      description: 'Cutting-edge technology integration for maximum efficiency and precision.'
    },
    {
      icon: Globe,
      title: 'Global Reach',
      description: 'Serving customers worldwide with reliable machinery and support.'
    }
  ];

  const stats = [
    { number: '20+', label: 'Years Experience', icon: Award },
    { number: '165+', label: 'Countries Served', icon: Globe },
    { number: '1000+', label: 'Happy Customers', icon: Users },
    { number: '500+', label: 'Machinery Types', icon: Factory }
  ];

  return (
    <div className="min-h-screen">
      {/* Hero Section */}
      <HeroSection />

      {/* Features Section */}
      <section className="py-20 bg-gradient-to-br from-gray-50 to-blue-50">
        <div className="container mx-auto px-4">
          <motion.div 
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-center mb-16"
          >
            <h2 className="text-4xl md:text-5xl font-bold text-gray-900 mb-6">
              Why Choose <span className="text-primary-600">Vanguard</span>?
            </h2>
            <p className="text-xl text-gray-600 max-w-3xl mx-auto">
              We combine decades of experience with cutting-edge technology to deliver the best machinery solutions for your business.
            </p>
          </motion.div>

          <div className="grid md:grid-cols-3 gap-8">
            {features.map((feature, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                className="bg-white rounded-2xl p-8 shadow-lg hover:shadow-xl transition-all duration-300 group"
              >
                <div className="w-16 h-16 bg-primary-100 rounded-xl flex items-center justify-center mb-6 group-hover:bg-primary-200 transition-colors">
                  <feature.icon className="w-8 h-8 text-primary-600" />
                </div>
                <h3 className="text-2xl font-bold text-gray-900 mb-4">{feature.title}</h3>
                <p className="text-gray-600 leading-relaxed">{feature.description}</p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Company Stats */}
      <CompanyStats stats={stats} />

      {/* Featured Products */}
      <section className="py-20 bg-white">
        <div className="container mx-auto px-4">
          <motion.div 
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-center mb-16"
          >
            <h2 className="text-4xl md:text-5xl font-bold text-gray-900 mb-6">
              Featured <span className="text-primary-600">Machinery</span>
            </h2>
            <p className="text-xl text-gray-600 max-w-3xl mx-auto">
              Discover our most popular and innovative machinery solutions designed for modern manufacturing.
            </p>
          </motion.div>

          <FeaturedProducts products={featuredProducts} isLoading={isLoading} />

          <div className="text-center mt-12">
            <Link
              to="/products"
              className="inline-flex items-center px-8 py-4 bg-primary-600 text-white font-semibold rounded-lg hover:bg-primary-700 transition-colors duration-300 group"
            >
              View All Products
              <ChevronRight className="ml-2 w-5 h-5 group-hover:translate-x-1 transition-transform" />
            </Link>
          </div>
        </div>
      </section>

      {/* Service Highlights */}
      <ServiceHighlights />

      {/* Testimonials */}
      <Testimonials />

      {/* Call to Action */}
      <CallToAction />
    </div>
  );
};

export default Home;
